import React, { useEffect, useState }  from "react";

function Form(){

    const [backEndData, setBackendData] = useState([{}])
    function validateCheck(event){
        useEffect(() => {
            fetch("/validate").then(
                response => response.json()
            ).then(
                data => {
                    setBackendData(data)
                }
            )
        }, [])

        console.log(backEndData)

    }

    return (
        <div>
            <form className="number-form" action="/" method="post">

                <input type="text" name="phoneNumber" placeholder="phone number" required="True"/>
                <input type="submit" value="submit"/>

            </form>

            <form className="code-form" id="access-code-validate" action="/validate" method="post" onSubmit={validateCheck}>

                <input type="text" name="accessCode" placeholder="access code" required="True"/>  
                {/* <input type="submit" value="validate"/> */}

            </form>

            <button type="submit" form="access-code-validate">Validate</button>
        </div>
    )
}

export default Form
